import React, { useState } from "react";
import LandingPage from "./components/LandingPage";
import RegisterPage from "./components/RegisterPage";
import LoginPage from "./components/LoginPage";
import RentPage from "./components/RentPage";
import ParttimeJob from "./components/ParttimeJob";
import JobResults from "./components/JobResults";

function App() {
  const [page, setPage] = useState("landing"); // start with landing page
  const [user, setUser] = useState(null);

  // Register handler
  const handleRegister = (data) => {
    console.log("✅ User Registered:", data);
    setUser(data);
    setPage("login"); // after register go to login
  };

  // Login handler
  const handleLogin = (credentials) => {
    console.log("✅ User Logged In:", credentials);
    setPage("rent"); // after login go to rent
  };

  // Navigation flow
  return (
    <>
      {page === "landing" && <LandingPage onNext={() => setPage("register")} />}

      {page === "register" && (
        <RegisterPage onRegister={handleRegister} />
      )}

      {page === "login" && (
        <LoginPage onLogin={handleLogin} />
      )}

      {page === "rent" && (
        <RentPage onNext={() => setPage("parttime")} />
      )}

      {page === "parttime" && (
        <ParttimeJob onNext={() => setPage("results")} />
      )}

      {page === "results" && (
        <JobResults onNext={() => setPage("landing")} />
      )}
    </>
  );
}

export default App;
